import Link from 'next/link'

import React, { Component } from 'react'

class Layout extends Component {
    render () {
        return (
            <div>
                <header>
                    <Link href="/">
                        <a >
                            Podcast
                        </a>
                    </Link>
                </header>

                <style jsx>{`
                header{
                        color: fff;
                        background: #8756ca;
                        padding: 15px;
                        text-align: center;
                    }
                
                header a {
                    color: ffff;
                }
                `}</style>

                

            </div>
        )
    }
}

export default Layout
